import React from 'react';

import classes from './NavBar.module.css';

const NavBar = () => {
  const homeHandler = () => {};
  const shopHandler = () => {};
  const cartHandler = () => {};
  const loginHandler = () => {};
  return (
    <span className={classes.navBar}>
      <button onClick={homeHandler}>Home</button>
      <button>Shop</button>
      <header>BOUTIQUE</header>
      <button>Cart</button>
      <button>Login</button>
    </span>
  );
};

export default NavBar;
